script: |
  super -f text -I q3320.spq | sort > q3320.out

inputs:
  - name: q3320.spq
    data: |
      SELECT ALL col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN + - col2 AND col2 / + - CAST ( NULL AS INTEGER ) - - + CAST ( + 82 AS INTEGER ) + - + col2;
  - name: tab0

outputs:
  - name: q3320.out
    data: |
